/* eslint-disable react-hooks/exhaustive-deps */
import { useState, useEffect } from 'react'
import { Container } from "react-bootstrap"
import { useParams } from "react-router-dom"
import ProfileHeader from "../components/profile/header/ProfileHeader"
import { ApiService } from '../API/ApiService'

const UserProfile = () => {
  const param = useParams<{id: string}>()
  const [gotUser, setGotUser] = useState({})
  const fetching = async () => {
    return await ApiService.getOneUser(Number(param.id))
  }

  useEffect(() => {
    const userFromAPI = fetching()
    setGotUser(userFromAPI)
  }, [])

  console.log(gotUser);

  return (
    <Container>
        {/* <ProfileHeader userLogin={gotUser!.username} userEmail={gotUser!.email} loading={loading}/> */}
    </Container>
  )
}

export default UserProfile
